import { useState, useEffect } from "react";

function App() {
  const [toDO, setToDO] = useState();
  const onChange = (event) => setToDO(event.target.value);
  console.log(toDO);
  return (
    <div>
      <form>
        <input
          onChange={onChange}
          type="text"
          placeholder="write your to do"
        ></input>
      </form>
    </div>
  );
}

export default App;
